import React from "react";
import { logo } from "../Imports/images";
import { DirectCall } from "../Imports/Index";
const Dashboard = () => {
  return (
    <React.Fragment>
      <div className="dashboard_container background_main_color">
        <div className="dashboard_left_section">
          <div className="dashboard_content_container">
            <DirectCall />
            {/* <GroupCall />
            {callState !== callStates.CALL_IN_PROGRESS && (
              <DashboardInformation username={username} />
            )} */}
          </div>
          <div className="dashboard_rooms_container background_secondary_color">
            {/* <GroupCallRoomsList /> */}
          </div>
        </div>
        <div className="dashboard_right_section background_secondary_color">
          <div className="dashboard_active_users_list">
            {/* <ActiveUsersList /> */}
          </div>
          <div className="dashboard_logo_container">
            <img className="dashboard_logo_image" src={logo} alt="logo" />
          </div>
        </div>
        <footer>
          {" "}
          <small>&#9400; Copyright 2021, shubham khatal</small>{" "}
        </footer>
      </div>
    </React.Fragment>
  );
};

export default Dashboard;
